  b 20.07.1925 d 18.05.1995
  b 13.07.1928
  Peter b. at Lower Moutere, m. at Holy Trinity Church, Gisborne and d. at Wanganui. Valerie, d/o Stanley
  David Nathan and Constance Mina Dunlop, b. at Gisborne. Address: 3 Hampton Place, Springvale, Wanganui.
  Peter was educated at Hereworth School, Wanganui Collegiate School and Otago University (BSc) and was a
  schoolmaster at Hereworth School and Wanganui Collegiate School. Valerie was a physiotherapist.
  01> MACKAY, Susan Jane m on 17.05.1975 to (1)HISCOCK, Keith Russell
  b 20.06.1953
  b 29.08.1954
  Susan b. at Hastings and m. at Rudgwick, England. She lived at Hereworth School, Havelock North
  until 1962. She was educated at Nga Tawa, Marton. In 1971 she nursed for a year in Wellington
  before attending Canterbury University. On leaving university in 1974 she worked in the medical
  records library of St Vincent's Hospital, Sydney. In 1975-76 she worked for IBM, Havant, England
  and John Wylies Book Publishing Company in Chichester. After returning to New Zealand she worked
  for the Wanganui Chronicle.
  01> CAMPION, Daniel Russell
  b 31.08.1976
  Daniel b. at Portsmouth, England. He attended Huntley School, Marton for four years followed by
  three years at Palmerston North Boys' High School where he achieved 98% in School Certificate
  Art. He attended Awatapu College for two years gaining a B Bursary and he is now completing a
  four-year Fine Arts degree course at Wanganui Polytechnic.
